import React from 'react';
import './AdminSidebar.css';

const AdminSidebar = ({ setSelectedSection }) => {
    const menuItems = [
        { name: 'Home', section: 'home' },
        { name: 'Critérios', section: 'criterios' },
        { name: 'Slider', section: 'slider' },
        { name: 'Compare', section: 'compare' },
        { name: 'Órgãos Regulamentadores', section: 'orgaos' },
        { name: 'Desconto', section: 'desconto' },
        { name: 'Blogs', section: 'blogs' },
        { name: 'Faq', section: 'daq' },
    ];

    return (
        <aside className="admin-sidebar">
            <ul className="admin-menu">
                {menuItems.map((item) => (
                    <li 
                        key={item.section} 
                        onClick={() => setSelectedSection(item.section)}
                        className="admin-menu-item"
                    >
                        {item.name}
                    </li>
                ))}
            </ul>
        </aside>
    );
};

export default AdminSidebar;
